import { NavLink } from "react-router-dom";
import instagram from "./instagram.png";

function Footer() {
    return(
        <>
        <NavLink to={"https://www.instagram.com/tenomareen/"}><img src={instagram} alt={"src"} height={48}></img></NavLink>
        </>
    );
}

export default Footer;
